function Set(){"use strict";this.set=[]}Set.prototype.getSet=function(){"use strict";return this.set};Set.prototype.size=function(){"use strict";return this.set.length};Set.prototype.get=function(e){"use strict";return this.set[e]};Set.prototype.isEmpty=function(){"use strict";return this.set.length<=0};Set.prototype.clear=function(){"use strict";this.set=[];return this};Set.prototype.contains=function(e){"use strict";return e&&this.set.indexOf(e)!==-1};Set.prototype.containsAll=function(e){"use strict";if(e&&e instanceof Array){for(var t=0,n=e.length;t<n;t+=1){if(!this.contains(e[t])){return false}}return true}return false};Set.prototype.add=function(e){"use strict";if(e){if(!this.contains(e)){this.set.push(e)}}return this};Set.prototype.addAll=function(e){"use strict";if(e&&e instanceof Array){for(var t=0,n=e.length;t<n;t+=1){if(!this.contains(e[t])){this.add(e[t])}}}return this};Set.prototype.remove=function(e){"use strict";if(e&&this.contains(e)){var t=[],n=this.set.indexOf(e);for(var r=0,i=this.size();r<i;r+=1){if(r!==n){t.push(this.set[r])}}this.set=t}return this};Set.prototype.removeAll=function(e){"use strict";if(e&&e instanceof Array){for(var t=0,n=e.length;t<n;t+=1){this.remove(e[t])}}return this}
